import React from 'react'
import Box from '@mui/material/Box';
import { Avatar } from '@mui/material';

function ViewProduct() {
  return (
    <Box sx={{display: 'flex'}}>
        <Box sx={{ order: 1 }}>
        <Avatar alt="Remy Sharp" src="https://media.istockphoto.com/photos/blue-jean-shirt-isolated-on-white-background-picture-id584479824?k=20&m=584479824&s=612x612&w=0&h=TaUNU0xfxEMD4NM3DFGM73uVceElRKbd1BX2cygkzDA=" variant="square" sizes="lg" />
        </Box>
        <Box sx={{ order: 2 }}>

        </Box>
    </Box>
  )
}

export default ViewProduct
